import React from 'react';
import { checkPropTypes } from 'prop-types';


const Spinner = (props) =>{
    return(
        <div className="ui active dimmer">
            <div className="ui big text loader">
                {props.message}
            </div>
        </div>
    );
}
Spinner.defaultProps = {
    message:'loading'
}
export default Spinner;
